class Solution:
    # @param {string} s
    # @return {integer}
    def lengthOfLongestSubstring(self, s):
        longest = 0
        map = {}
        left = 0
        right = 0
        while right < len(s):
            if s[right] in map:
                left = max(left, map[s[right]] + 1)
            map[s[right]] = right
            longest = max(longest, right - left + 1)
            right += 1
        return longest

